import Button from "./Button";
import {useState} from 'react';

export default function Project() {
    const pages = 5;
    const [page, setPage] = useState(1);

    function doNext() {
        if(page < 5) {
            setPage( p => p + 1);
        }
    }
    function doPrev() {
        if(page > 1) {
            setPage( p => p - 1);
        }
    }
    return (
        <div className="content">
            <Button
                value={"Next"}
                setValue={doNext}
            />
        </div>
    )
}
